import styled from 'styled-components';

const lightTheme = {
    footerBg:"#051c38",
}

const darkTheme = {
    footerBg:"#0bbdab",
}

export const FooterWrapper = styled.div`
    padding:6rem;
    disp
    background: ${ props => props.isDark ? darkTheme.footerBg : lightTheme.footerBg};  
`;
